// contracts/DungeonsAndDragonsCharacter.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.6;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@chainlink/contracts/src/v0.6/VRFConsumerBase.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract LucyAndJeff is ERC721, Ownable {
    using SafeMath for uint256;
    using Strings for string;

    struct Properties {
        uint256 liberty;
        uint256 anarchy;
        uint256 tacos;
        uint256 kisses;
        uint256 bitcoin;
        uint256 monero;
        string name;
    }

    Properties[] public properties;

    mapping(bytes32 => address) requestToSender;
    mapping(bytes32 => uint256) requestToTokenId;

    /**
     * Constructor inherits VRFConsumerBase
     *
     * Network: Rinkeby
     * Chainlink VRF Coordinator address: 0xb3dCcb4Cf7a26f6cf6B120Cf5A73875B7BBc655B
     * LINK token address:                0x01BE23585060835E02B77ef475b0Cc51aA1e0709
     * Key Hash: 0x2ed0feb3e7fd2022120aa84fab1945545a9f2ffc9076fd6156fa96eaff4c1311
     */
    constructor() public ERC721("LucyAndJeff", "L&J") {}

    function getTokenURI(uint256 tokenId) public view returns (string memory) {
        return tokenURI(tokenId);
    }

    function setTokenURI(uint256 tokenId, string memory _tokenURI) public {
        require(
            _isApprovedOrOwner(_msgSender(), tokenId),
            "ERC721: transfer caller is not owner nor approved"
        );
        _setTokenURI(tokenId, _tokenURI);
    }

    function mintLucyAndJeff() internal {
        uint256 newId = properties.length;
        uint256 liberty = 100;
        uint256 anarchy = 100;
        uint256 tacos = 100;
        uint256 kisses = 100;
        uint256 bitcoin = 100;
        uint256 monero = 100;

        properties.push(
            Properties(
                liberty,
                anarchy,
                tacos,
                kisses,
                bitcoin,
                monero,
                "Jeff And Lucy"
            )
        );
        _safeMint(msg.sender, newId);
    }

    function getNumberOfLucyAndJeff() public view returns (uint256) {
        return properties.length;
    }

    function getLucyAndJeffOverView(uint256 tokenId)
        public
        view
        returns (string memory, uint256)
    {
        return (
            properties[tokenId].name,
            properties[tokenId].liberty +
                properties[tokenId].anarchy +
                properties[tokenId].tacos +
                properties[tokenId].kisses +
                properties[tokenId].monero +
                properties[tokenId].bitcoin
        );
    }

    function getLucyAndJeffStats(uint256 tokenId)
        public
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256
        )
    {
        return (
            properties[tokenId].liberty,
                properties[tokenId].anarchy,
                properties[tokenId].tacos,
                properties[tokenId].kisses,
                properties[tokenId].monero,
                properties[tokenId].bitcoin
        );
    }

    function sqrt(uint256 x) internal view returns (uint256 y) {
        uint256 z = (x + 1) / 2;
        y = x;
        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }
    }
}
